//         style="font-size: 12pt; background-color: rgb(45, 194, 107);">mpn21:</span><span
//         style="font-size: 12pt;"> Thanks!</span></p>
// <ol>
//     <li><span data-preserver-spaces="true"><a id="Logical_step_1"></a>The
//             function calculates the difference between thor and light (x,y)
//             positions to determine the resultant vector and resultant angle
//             (theta). A resultant angle equal to zero will determine a
//             straight-direction, and a non-zero resultant angle will indicant
//             a cross direction. As shown in the image below, are arbitrary
//             positions for Thor, T (3,1) and Ligh, L (1,2). A right-angle
//             triangle can represent the displacement of these two objects with
//             the most extended length known as the resultant and its angle
//             known as the resultant angle (theta). As shown in the image
//             below, the difference between Light with respect to Thor in the x
//             direction is calculated as delta_x, (3-1) = 2. Consequently, the
//             calculation required for the delta_y variable will require an
//             additional step to determine the Light position with respect to
//             Thor in the y-direction. The y-component for the Light and Thor
//             is multiplied by -1 to convert the object's position in the
//             standard Cartesian coordinate, avoiding the graphical programming
//             coordinate standards. Afterward, the difference in the
//             y-component for delta-y is calculated, (1*-1) - (2*-1) = 1. As a
//             result, the difference between Light and Thor yields an x and y
//             component of (2, 1) or, in other words, delta_x = 2 and delta_y =
//             1.&nbsp;</span><br><img
//             style="display: block; margin-left: auto; margin-right: auto;"
//             src="data:image/jpeg;base64,"
//             width="595" height="166">Furthermore, the resultant vector and
//         angle can be determined using delta_x and delta_y. As shown in the
//         image below, basic trigonometry is used to determine the resultant
//         vector, using the right triangle trigonometry equation r =
//         sqrt(x^2+y^2) = sqrt(4 +1) = sqrt(5) = 2.24. As a comparison, moving
//         Thor in straight directions will result in 3 movements (2 steps to
//         the East and 1 step to the North). Therefore proves that
//         cross-direction r is the shortest path compared to the straight
//         direction. Meanwhile, the theta is inverse tan(y/x) = inverse
//         tan(1/2) = 26.56 degrees.&nbsp;<br><img
//             style="display: block; margin-left: auto; margin-right: auto;"
//             src="data:image/jpeg;base64,"
//             width="605" height="205"> &nbsp;</li>
//     <li><a id="Logical_Step_2"></a>The value of theta is a helpful indicator
//         to determine whether Thor is to move in the cross-direction or
//         straight direction. In other words, when theta is zero, the
//         displacement of the Light must be either straight above (N), below
//         (S), left (E), or right (W) with respect to Thor. As shown in the
//         image below, a negative theta is calculated when the Light is
//         displaced in quadrant two. In contrast to the example above, the sign
//         for theta is positive when the Light is located in quadrant 1.
//         Therefore, the magnitude and sign (+/-) will not distinguish the
//         quadrant location of the Light. As a result, Thor is to move in a
//         cross-direction when theta is non-zero, regardless of the sign, and
//         the quadrant position is determined. The quadrant position for the
//         Light is distinguished by comparing the sign (+/-) of the delta_x and
//         delta_y. For example, quadrant-1 would yield a positive delta_x and
//         delta_y. Meanwhile, quadrant-3 would yield a negative delta_x and
//         delta_y. Below are the four cases for cross-direction movements:<br>
//         <ol>
//             <li>If the light is in quadrant I with respect to thor position
//                 then (delta_x is positive and delta_y is positive); move
//                 Thor, NE</li>
//             <li>If the light is in quadrant II with respect to thor position
//                 then (delta_x is negative and delta_y is positive);move Thor,
//                 NW</li>
//             <li>If the light is in quadrant III with respect to thor position
//                 then (delta_x is negative and delta_y is negative);move Thor,
//                 SE</li>
//             <li>If the light is in quadrant IV with respect to thor position
//                 then (delta_x is positive and delta_y is negative);move Thor,
//                 SW<img
//                     style="display: block; margin-left: auto; margin-right: auto;"
//                     src="data:image/jpeg;base64,"
//                     width="567" height="392"></li>
//         </ol>
//     </li>
//     <li><a id="Logical_Step_3"></a>After completing the cross-direction
//         logic, the logic for straight-direction movement must be verified. As
//         discussed, the resultant angle, theta, when equal to zero, would
//         yield a straight-direction (N, S, E, or W) movement. The following
//         cases determine Thor's straight-direction movement:<br>
//         <ol>
//             <li>If delta_x is zero then Thor and the Light are on the same
//                 x-plane. To determine whether the light y-position is above
//                 or below with respect to Thor, the following cases are
//                 verified:&nbsp;<br>
//                 <ol>
//                     <li>If delta_y is positive then the Light is above Thor;
//                         move Thor, N</li>
//                     <li>If delta_y is negative then the Light is below Thor;
//                         move Thor, S&nbsp;</li>
//                 </ol>
//             </li>
//             <li>If delta_y is zero then Thor and the Light are on the same
//                 y-plane. To determine whether the light x-position is to the
//                 left or right with respect to Thor, the following cases are
//                 verified:&nbsp;<br>
//                 <ol>
//                     <li>If delta_x is positive then the Light is to the left
//                         of Thor; move Thor, E</li>
//                     <li>If delta_x is negative then the Light is to the right
//                         of Thor; move Thor, W</li>
//                 </ol>
//             </li>
//         </ol>
//     </li>
// </ol>
