// <h2>Overview of the Main Function&nbsp;</h2>
// <p>The main function contains several default parameters established by the
//     Power of Thor. The programmer starts the code by initializing variables
//     and then handles the initial state of the program. The program's initial
//     state required reading Thor's initial x and y positions. As discussed in
//     <a href="#Assumption2">assumption - 2</a>, the programmer must track the
//     movement of Thor, requiring the need to establish initial state flags.
//     Furthermore, the direction function keeps track of the movement and
//     displacement of Thor's position after each movement.&nbsp;</p>
// <p><span style="background-color: rgb(251, 238, 184);">jh3768</span>: I
//     appreciate how you keep the code together and link back to any relevant
//     descriptions, calculations, etc. The variable names are also well-made
//     and help in understanding the code.</p>
// <p><span
//         style="font-size: 12pt; background-color: rgb(45, 194, 107);">mpn21:</span><span
//         style="font-size: 12pt;"> Thanks!</span></p>
// <p>&nbsp;</p>
int main()
{
    int light_x;    // the X position of the light of power
    int light_y;    // the Y position of the light of power
    int initial_tx; // Thor's starting X position
    int initial_ty; // Thor's starting Y position
    cin >> light_x >> light_y >> initial_tx >> initial_ty; cin.ignore();
    
    //Initialize variables
    bool initialstate = true;
    int current_thor_x=0, current_thor_y=0, next_thor_x=0, next_thor_y=0;

    while (1) {
        int remaining_turns; // The remaining amount of turns Thor can move. Do not remove this line.
        cin >> remaining_turns; cin.ignore();
        
        if (initialstate == true){
            direction(initial_tx, initial_ty, light_x, light_y, &next_thor_x, &next_thor_y);
            initialstate = false;}
        else if (initialstate == false){
            current_thor_x = next_thor_x;
            current_thor_y = next_thor_y;
            direction(current_thor_x, current_thor_y, light_x, light_y, &next_thor_x, &next_thor_y);}
        else {
        cerr <<"NOP: Undetermined state" << endl;}     
    } //end while

} //end main

