void direction(int current_thor_x, int current_thor_y, int current_light_x, int current_light_y, int* next_thor_x, int* next_thor_y)
{
    int thor_x, thor_y, light_x, light_y, delta_x, delta_y;
    double resultant_vector;
    double theta;
    double ratio;
    bool quad1, quad2, quad3, quad4;

    //Initializ variables
    quad1 =false; quad2=false; quad3=false; quad4=false;
    thor_x = current_thor_x;
    thor_y = current_thor_y;
    light_x = current_light_x;
    light_y = current_light_y;

    //Calculate the distance between thor and the light
    delta_x = light_x - thor_x;
    delta_y = (light_y*-1) - (thor_y*-1);   //Multiply y pos by -1 normalizes the position to standard cartisean system 
    resultant_vector = sqrt(delta_x*delta_x + delta_y*delta_y);
    
    cerr << "Delta_x: " << delta_x <<endl;
    cerr << "Delta_y: " << delta_y <<endl;
    cerr << "resultant_vector: " << resultant_vector << endl;

// <p>For explaination <img
//         style="width: 1em; height: 1em; margin: 0 .05em 0 .1em; vertical-align: -.1em;"
//         draggable="false"
//         src="https://twemoji.maxcdn.com/v/13.0.1/72x72/1f9d0.png" alt="🧐"
//         data-emoticon="true">, See&nbsp;<a href="#Logical_step_1">Logical
//         Step # 1</a>&nbsp;</p>

    //Calculate the angle of the resultant vector
    if (delta_y == 0){ 
        ratio = 0;}
        else if (delta_x == 0){             //error handling, when 1/0 occurs results in undef; set denominator to zero to avoid crashing the software
        ratio = 0;}
    else{
        ratio = delta_y * (delta_x)^-1;}     //discovered software bug, delta_y/delta_x yields inconsistent calculation. (delta_x)^-1 provided consistent calculations 
    
    theta = (atan(ratio) * 180 / M_PI);
    cerr << "ratio: " << ratio << endl;
    cerr << "theta: " << theta <<endl;

// <p>For explaination <img
//         style="width: 1em; height: 1em; margin: 0 .05em 0 .1em; vertical-align: -.1em;"
//         draggable="false"
//         src="https://twemoji.maxcdn.com/v/13.0.1/72x72/1f928.png" alt="🤨"
//         data-emoticon="true">, see <a href="#Logical_Step_2">Logical Step
//         #2</a></p>

    //Determine where the quadrant where the light is located with respect to Thor
    if ((delta_x >= 0) && (delta_y >=0) ) {   
        quad1=true;
        cerr << "Quad: " << "1" <<endl;}
        
    else if ( (delta_x <= 0) && (delta_y >= 0) ) {   
        quad2=true;
        cerr << "Quad: " << "2" <<endl;}
        
    else if ( (delta_x <= 0) && (delta_y <= 0) ) {   
        quad3=true;
        cerr << "Quad: " << "3" <<endl;}
        
    else if ( (delta_x >= 0) && (delta_y <= 0) ) {   
        quad4=true;
       cerr << "Quad: " << "4" <<endl;}
    else{
        quad1 =false; quad2=false; quad3=false; quad4=false;
       cerr << "No Quad" << endl;}

    //Determine whether a cross-direction (NE, NW, SE, SW) move is required
    if ( (quad1 == true) && (theta != 0) ) {
        cout << "NE" << endl;
        *next_thor_x = thor_x + 1;
        *next_thor_y = thor_y + 1; 
        }
    
    else if ( (quad2 == true) && (theta != 0) ) {
        cout << "NW" << endl;
       *next_thor_x = thor_x - 1;
       *next_thor_y = thor_y + 1; 
        }

    else if ( (quad3 == true) && (theta != 0) ) {
        cout << "SW" << endl;
       *next_thor_x = thor_x - 1;
       *next_thor_y = thor_y + 1; 
       }

    else if ( (quad4 == true) && (theta != 0) ) {
        cout << "SE" << endl;
        *next_thor_x = thor_x + 1;
        *next_thor_y = thor_y + 1; 
        }
    else{
        cerr <<"NOP: No cross-direction" << endl;}

// <p>For explaination <img
//         style="width: 1em; height: 1em; margin: 0 .05em 0 .1em; vertical-align: -.1em;"
//         draggable="false"
//         src="https://twemoji.maxcdn.com/v/13.0.1/72x72/1f914.png" alt="🤔"
//         data-emoticon="true">, see&nbsp;<a href="#Logical_Step_3">Logical
//         Step # 3</a></p>

    //Determine whether a straight-direction (N, S, E, W) move is required
    if (theta == 0){
        if (delta_x == 0){
            if (delta_y > 0) {cout << "N" << endl;
            *next_thor_x = thor_x;
            *next_thor_y = thor_y - 1; }
            else if (delta_y < 0) {cout << "S" << endl;
            *next_thor_x = thor_x;
            *next_thor_y = thor_y + 1;}
        }
        else if (delta_y == 0){
            if (delta_x >=0) {cout << "E" << endl;
            *next_thor_x = thor_x + 1;
            *next_thor_y = thor_y;}
            else if (delta_x <=0){ cout << "W" << endl;
            *next_thor_x = thor_x - 1;
            *next_thor_y = thor_y;}
        }
    }
    else {
        cerr << "NOP: No straight-direction" << endl;
        }
        
}
